import React from 'react'
import Task from '../Task/Task'
import Filter from '../Filter/Filter'
import Input from '../Input/Input'
import './Tasks.css';

const Tasks = (props) => {
    return (
        <div className='tasks'>
            <Input/>
            {props.tasks.map((item, key) => <Task val={item} key={key} />)}
            <Filter/>
        </div>
    )
}

export default Tasks
